import React from "react";
import { useAuth0 } from "@auth0/auth0-react";

const LoginButton = () => {
  const { loginWithRedirect } = useAuth0();
  return (
    <button
      className="btn btn-primary btn-block" class = "font-medium text-gray-50 h-1 w-40 bg-green-400 rounded-3xl hover:bg-blue-400"
      onClick={() => loginWithRedirect()}
    >
      Log In | Sign Up
    </button>
  );
};

export default LoginButton;
